[Description]
Northem is a north-bluish dark theme based on the same named color palette designed by Arctic Ice Studio.
This is a light and more color-intensive variation.

[Variations]
Also available as:
  - "Northem Atom Syntax"         (https://github.com/arcticicestudio/northem-atom-syntax)
  - "Northem Dark Atom Syntax"    (https://github.com/arcticicestudio/northem-dark-atom-syntax)

Make sure to check out "Northem Light Atom UI" (https://github.com/arcticicestudio/northem-light-atom-ui)!

[Other Projects]
  - "Northem Light Eclipse Syntax"    (https://github.com/arcticicestudio/northem-light-eclipse-syntax)
  - "Northem Light gedit"             (https://github.com/arcticicestudio/northem-light-gedit)
  - "Northem Light GTK"               (in drafting)
  - "Northem Light Notepad++"         (https://github.com/arcticicestudio/northem-light-notepadplusplus) (Windows only)

Visit the official homepage http://arcticicestudio.com/Northem (actually under construction) for more informations.

[Languages]
Syntax Highlighting actually includes:
  - C               (https://atom.io/packages/language-c)
  - Clojure         (https://atom.io/packages/language-clojure)
  - CoffeeScript    (https://atom.io/packages/language-coffee-script)
  - CS (C#)         (https://atom.io/packages/language-csharp)
