[Changelog]
Check out the "CHANGELOG.md" file or open via "Settings" > "Packages" and filter for "northem-light-atom-syntax".
All changelogs are available at the GitHub Repository (https://github.com/arcticicestudio/northem-light-atom-syntax) and http://arcticicestudio.com/Northem (actually under construction).

[Development]
Please report bugs and suggestions for improvement/language support at https://github.com/arcticicestudio/northem-light-atom-syntax/issues.

[Recommendations]
This theme matches the Open Source font "Source Code Pro" (https://typekit.com/fonts/source-code-pro).
Visit the GitHub Repository at "https://github.com/adobe-fonts/source-code-pro" for more informations.

The colored file icons on the preview screenshot are provided by the "file-icons" (https://atom.io/packages/file-icons) package.

[Installation]
Download and install the recommended font, read section "Recommendations" for more informations.

Install via "apm": "apm install northem-light-atom-syntax"
Alternatively open "Settings" > "Install", set the filter to "Themes" and search for "northem-light-atom-syntax".

Activate it by going to the "Settings" > "Themes" section and select "Northem Light" from the "Syntax Theme" drop-down menu.

